import React from 'react';
import Movement from '../../components/movement';

function edit_vacancy() {
    return (
        <div id="editar" className="container"> 
            <Movement title="CV Analitcs" />
            <main>
                <legend>Editar Vaga</legend>
            </main>


        </div>
    )
}

export default edit_vacancy;
